import React, { Component } from 'react';
import './App.css';
import List from './list.js'

class App extends Component {
  constructor(props, context) {
    super(props, context);
    this.state = { todos:["start"] }
  } 
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>
           To-Do-List
          </p>
        </header>
        <input className= "addTodo" id="text" type="text" name="addTodo" placeholder="Add todo" ></input>
        <List todos={this.state.todos}>
        {console.log(this.state.todos)}</List>
      </div>
    );
  }
}

export default App;
